import {SubmitHandler, useForm} from "react-hook-form";



interface Param {
    dName ?: string;
    dCell ?: string;
    dJumin ?: string;
    carType ?: string;
    carNum ?: string;
    tranType ?: string;
}

export default function RegisterForm() {
    const {
        register,
        watch,
        handleSubmit,
        formState: { errors },
    } = useForm<Param>({
        defaultValues: {
            dName : '',
            dCell : '',
            dJumin : '',
            carNum : '',
            carType : '',
            tranType : '',
        },
        mode: 'onChange',
    });

    return (
        <div className='w-full flex flex-col'>
            <form className='w-full mx-4'>
                <div className='w-full flex'>
                    <label>
                        이름
                    </label>
                    <input type={'text'} />
                </div>
            </form>

        </div>
    )
}
